import{_ as a}from"./chunks/index.VAya1KE4.js";import{c as p,o as e,G as s,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const r=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":503612,"idList":[504621,504570,504440,501214,503614,501157,501213,6489,3386,1058,1433,1056,1220,1498,503613,503612,4074,4073,500207,1290,502928,502927,5111,1627,502306,500987,501624,2404,501625,501626,2142,4334,6180,59,75,1057,501441,4081,500419,5020,500291,5865,500286,6937,500673,4780,5494,3875,3564,3276,1360,2040,57,2123,2403,2124,55,111,1744,501212,500672,500605,500292,7257,6938,6594,6490,6285,5866,5493,5297,4781,4736,4333,4197,4148,3387,3275,2606,2125,2402,78,382,105,92,241,1221,54,644,56,61,112,76,79,1055,1291,1795,2415],"data":{"id":503612,"name":"茜特菈莉","summary":"白星黑曜 · 茜特菈莉","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/12/25/4328207/37aa13adb9419746ac29fe13893f2d91_3053993473631843068.png","avatar":{"m":"https://act-upload.mihoyo.com/wiki-user-upload/2024/12/25/4328207/d007e5519deb603792f65d0cbd84e60f_7369607418312975309.png","pc":"https://act-upload.mihoyo.com/wiki-user-upload/2024/12/25/4328207/3f7bda7d67126b08d2f4bca8e4547f23_606253452718689184.png"},"attrs":[["地区","纳塔"],["星级","五星"],["神之眼所属","纳塔"],["元素","冰"],["武器","法器"],["生日","1月20日"],["所属","米克特兰"],["定位","冰元素辅助角色"],["武器类型","法器"],["命之座","石心镜座"],["称号","白星黑曜"]],"destiny":[["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/02676a47ea4c703b1942519b8d8189ad_5143900887069628361.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/02676a47ea4c703b1942519b8d8189ad_5143900887069628361.png\\" style=\\"width: 40px;\\"></span></span></span>四百星的芒刃</p>","<p>施放元素战技霜昼黑星时，茜特菈莉将获得「白星之裙」效果，持续至伊兹帕帕退场：</p><p>持续期间，茜特菈莉获得10层「星刃」，除茜特菈莉外的附近的当前场上角色的普通攻击、重击、下落攻击、元素战技或元素爆发造成伤害时，将消耗1层「星刃」，提升造成的伤害，提升值相当于茜特菈莉元素精通的200%。</p><p>队伍中附近的角色触发冻结反应或融化反应后，茜特菈莉将额外获得3层「星刃」，该效果每8秒至多触发一次。</p><p>施放元素战技霜昼黑星时，「星刃」的层数将会刷新。</p><p>此外，茜特菈莉进行腾跃、或是在空中进行瞄准或重击时，消耗的燃素降低45%。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/18f4c8749bfb046553be7912585fb79b_7438357874734784540.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/18f4c8749bfb046553be7912585fb79b_7438357874734784540.png\\" style=\\"width: 40px;\\"></span></span></span>吞心者的巡行</p>","<p>茜特菈莉的元素精通提升125点，处于白曜护盾的庇护下或是伊兹帕帕跟随的其他角色的元素精通提升250点。</p><p>此外，施放元素战技霜昼黑星时，也会为附近的当前场上角色赋予白曜护盾；</p><p>此外，固有天赋「五重天的寒雨」的效果获得提升：</p><p>伊兹帕帕存在期间，队伍中附近的角色触发冻结反应或融化反应后，受本次反应影响的敌人的火元素与水元素抗性还会额外降低20%，持续12秒，该效果需要解锁固有天赋「五重天的寒雨」。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/ae4acdf22be900752abc20000a1ebe33_5798006179470459683.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/ae4acdf22be900752abc20000a1ebe33_5798006179470459683.png\\" style=\\"width: 40px;\\"></span></span></span>云中蛇的羽冠</p>","<p>元素战技霜昼黑星的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/6daaf351e26127666d9f7cd88982243f_3219039102400531726.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/6daaf351e26127666d9f7cd88982243f_3219039102400531726.png\\" style=\\"width: 40px;\\"></span></span></span>拒亡者的灵髑</p>","<p>元素战技霜昼黑星中，伊兹帕帕的霜陨风暴命中敌人时，会额外召唤一个宿灵之髑·黑星，通过这种方式召唤的宿灵之髑发生爆炸时，会造成相当于茜特菈莉元素精通1800%的具有夜魂性质的冰元素范围伤害，并为茜特菈莉恢复16点夜魂值和8点元素能量，该效果每8秒至多触发一次。</p><p>该伤害不被视为元素爆发伤害。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/f2a55c0a7048fe04bfedbeae5588dcae_4449711152123649496.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/f2a55c0a7048fe04bfedbeae5588dcae_4449711152123649496.png\\" style=\\"width: 40px;\\"></span></span></span>五恶曜的咒缚</p>","<p>元素爆发诸曜饬令的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/78282add3990467b4259ee25dd5526de_2601626453348501843.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/78282add3990467b4259ee25dd5526de_2601626453348501843.png\\" style=\\"width: 40px;\\"></span></span></span>原动天的密契</p>","<p>元素战技霜昼黑星中召唤的伊兹帕帕将始终为白燧状态，夜魂值耗尽时，伊兹帕帕的白燧状态也不会结束。</p><p>此外，施放元素战技霜昼黑星时，伊兹帕帕将消耗所有夜魂值，并在存在期间内持续消耗夜魂值；每通过上述方式消耗1点夜魂值，茜特菈莉就会获得1点「秘律之数」。</p><p>「秘律之数」上限为40点，基于茜特菈莉持有的「秘律之数」，每1点「秘律之数」会使附近的队伍中所有角色获得1.5%火元素与水元素伤害加成，并使茜特菈莉造成的伤害提升2.5%。</p><p>伊兹帕帕退场时，或再次施放元素战技时，茜特菈莉持有的「秘律之数」将被移除。</p>"]],"skill":[{"title":"普通攻击·宿灵捕影","desc":"普通攻击\\n唤起烟谜主世代传承的秘仪，进行至多三段的攻击，造成冰元素伤害。\\n\\n重击\\n进入瞄准状态，并在长按结束时消耗一定体力，向瞄准的方向挥出一枚寒星，对路径上的敌人造成冰元素伤害。\\n\\n下落攻击\\n凝聚冰元素的力量，从空中下坠冲击地面，攻击下落路径上的敌人，并在落地时造成冰元素范围伤害。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/6b87b9407f8a0c91bee60071fb05c6fd_1462285877453063301.png"},{"title":"霜昼黑星","desc":"依凭烟谜主千年传承的密契，展开白曜护盾，并召唤（传闻中）无比可怖的「黑曜星魔」伊兹帕帕，造成具有夜魂性质的冰元素范围伤害。\\n白曜护盾的伤害吸收量受益于茜特菈莉的元素精通，对冰元素伤害有250%的吸收效果，并在展开护盾时，为茜特菈莉施加短暂的冰元素附着。\\n施放后，茜特菈莉将获得24点夜魂值，并进入夜魂加持状态。\\n\\n夜魂加持·茜特菈莉\\n伊兹帕帕退场时，茜特菈莉的夜魂加持将会结束。\\n\\n伊兹帕帕\\n·伊兹帕帕将跟随角色行动；\\n·若茜特菈莉拥有至少50点夜魂值，伊兹帕帕将进入白燧状态，持续消耗夜魂值，并卷起跟随角色的霜陨风暴，攻击范围内的敌人，造成具有夜魂性质的冰元素伤害；\\n·夜魂值耗尽时，伊兹帕帕的白燧状态也会结束。\\n\\n一般来说，象征不同星曜的意志是无法共存的：纯粹的黑如何能映入绝对的白呢？\\n不过，茜特菈莉对于颜色本身没有什么特殊的偏好，事情便也就这样成了。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/085d06b3181cc3497bfc4f00700bce8a_319926599686078065.png"},{"title":"诸曜饬令","desc":"驱使来自星天与大地的「盟友」，唤起冰风暴轰击前方区域，造成具有夜魂性质的冰元素范围伤害，为茜特菈莉恢复一定夜魂值，并在范围内至多3名敌人附近各自召唤一个宿灵之髑。\\n宿灵之髑会在一段时间后爆炸，造成具有夜魂性质的冰元素范围伤害，并为茜特菈莉恢复一定夜魂值。\\n\\n「呜啊，好了！别管什么黑曜白曜了！茜特菈琳、伊兹帕帕，给我一起上！」","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/dc8416aec8725e3e2624280c44b0f3bc_7938904706434269381.png"},{"title":"五重天的寒雨","desc":"伊兹帕帕存在期间，队伍中附近的角色触发冻结反应或融化反应后，受本次反应影响的敌人的火元素与水元素抗性还会降低20%，持续12秒；\\n此外，茜特菈莉还会恢复16点夜魂值，每8秒至多通过这种方式恢复一次夜魂值。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/93133fffe2f0c3a214fcbdc6be07df13_4794869833859156750.png"},{"title":" 白燧蝶的星衣","desc":"元素战技霜昼黑星中，伊兹帕帕的霜陨风暴造成的伤害提升，提升值相当于茜特菈莉的元素精通的90%；\\n元素爆发诸曜饬令中，冰风暴造成的伤害提升，提升值相当于茜特菈莉的元素精通的1200%。\\n此外，队伍中的附近的角色触发「夜魂迸发」时，茜特菈莉还会恢复4点夜魂值。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/c83e7747b736e955e493e586045ac88e_5482793181881369844.png"},{"title":"夜域赐礼·镜烟翾风","desc":"在纳塔存在燃素机制的区域时，能够进行夜魂传递·茜特菈莉。\\n当前场上角色位于一定高度的空中时，切换茜特菈莉登场时触发：\\n茜特菈莉将高高腾跃而起，并借助「白曜星魔·茜特菈琳」在空中飘行。\\n自己的队伍每10秒可以触发一次夜魂传递。\\n\\n长按瞄准时，茜特菈莉会进入「灵觉」状态，处于这种状态下时，茜特菈莉可以与「灵谜涂鸦」和「灵谜纹」交互，提取其中的信息与力量，这些物件的交互规则沿袭瞑视龙的交互规则。\\n\\n\\n此外，长按跳跃时，茜特菈莉将消耗75点体力腾跃而起；\\n在纳塔存在燃素机制的区域时，茜特菈莉将优先消耗5点燃素，腾跃至更高的高度。\\n位于空中时，茜特菈莉可以长按普通攻击，消耗燃素或体力进行瞄准与重击；\\n在空中进行重击时，茜特菈莉将优先消耗20点燃素。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/320298b570eb0d345d64515b438f9483_600947667042186419.png"},{"title":"奥秘传唱","desc":"在纳塔存在燃素机制的区域时，触发「夜魂迸发」能恢复20点燃素。\\n该效果在秘境、征讨领域、深境螺旋中无效。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2025/01/02/4328207/feea64dccabd6c479bd39b649d65e802_3313514590645343465.png"}]},"favModalLocalKey":"vitepress_game_ys_role_fav_modal","favLocalKey":"vitepress_game_ys_role_fav"},"relativePath":"game/ys/role/503612.md","filePath":"game/ys/role/[pkg].md"}'),i={name:"game/ys/role/503612.md"},g=Object.assign(i,{setup(o){return(c,d)=>(e(),p("div",null,[s(t(a))]))}});export{r as __pageData,g as default};
